// component : HTML 을 반환하는 함수 
// jsx : js 안의 HTML. 컴포넌트를 만들고 어떻게 사용하는지에 대한 것  

function Food({name, picture})
{
  // props.fav 와 {fav} 는 같은 구문이다.
  // console.log(props.fav);
  return <div>
    <h2>I like {name}</h2>
    <img src={picture} alt={name}></img>
  </div>

}

